import React from "react";
import Login from "./Login";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./Dashboard";


export default function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/">
            <Dashboard />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
        </Routes>
      </Router>
    </>
  )
}
